import Svg, { G, Path, Circle } from 'react-native-svg';
/* SVGR has dropped some elements not supported by react-native-svg: style */

export const IconTrioOutline = props => (
  <Svg
    width={22}
    height={22}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    {...props}
  >
    <G>
      <Path
        d="M5.4 4V2.2C5.4 1 6.4 0 7.6 0h6.7c1.2 0 2.2 1 2.2 2.2V4l.1.2c2.5 1.2 4.3 3.8 4.3 6.8s-1.7 5.5-4.2 6.8l-.1.3v1.7c0 1.2-1 2.2-2.2 2.2H7.6c-1.2 0-2.2-1-2.2-2.2V18l-.1-.2C2.8 16.6 1.1 14 1.1 11s1.7-5.6 4.2-6.8l.1-.2zm3.4 1.2c-3.4 0-6.2 2.6-6.2 5.8 0 3.2 2.8 5.8 6.2 5.8h4.3c3.4 0 6.2-2.6 6.2-5.8 0-3.2-2.8-5.8-6.2-5.8H8.8z"
        fill={Colors.HERO_BLUE}
      />
      <Circle cx={14.9} cy={11} r={2.8} fill={Colors.HERO_BLUE}/>
      <Path
        d="M10.1 13.3H5c-.4 0-.8-.3-.8-.8v-3c0-.4.3-.8.8-.8h5.1c.4 0 .8.3.8.8v3c-.1.4-.4.8-.8.8z"
        fill={Colors.HERO_BLUE}
      />
    </G>
  </Svg>
);
